export const initialState = {
  listing_result: null,
};

const reducer = (state, action) => {
  switch (action.type) {
    // User code started
    case "UPDATE_LISTING":
      console.log("changed")
      console.log(state.listing_result);
      return {
        ...state,
        listing_result: action.listing_result,
      };
    default:
      return state;
  }
};

export default reducer;
